// App.js
import React, { useEffect } from "react";
import "./App.css";
import { fetchMockData } from "./fetchMockData";
import { iUser } from "./users"; // Assurez-vous d'importer le type iUser depuis le fichier users

function App() {
  useEffect(() => {
    // Utilisez fetchData à l'intérieur d'un effet de chargement initial
    const fetchDataAndDoSomething = async () => {
      try {
        const userData: iUser[] = await fetchMockData();
        // Utilisez les données récupérées comme nécessaire
        console.log("Données dans le composant App:", userData);
      } catch (error) {
        // Gérez les erreurs ici
        console.error(
          "Erreur dans le composant App:",
          (error as Error).message
        );
      }
    };

    fetchDataAndDoSomething();
  }, []);

  return <div className="App">SportSee test.</div>;
}

export default App;
